updateSymptoms([]) :-!.
updateSymptoms([IDListHd|IDListTl]) :-
	person(IDListHd, Age, FamID, Sympts, IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList),
	(
		(

	 		( (Sympts \='dead'), 
				(DaysSinceExposed =:= IncubateDays), 
					retract(person(IDListHd, Age, FamID, Sympts, IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)), 
					assert(person(IDListHd, Age, FamID, 'fever', IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)) );
	 		( (Sympts \='dead'), 
				(DaysSinceExposed =:= (IncubateDays+4)), 
					retract(person(IDListHd, Age, FamID, Sympts, IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)), 
					assert(person(IDListHd, Age, FamID, 'rash', IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)) );
	 		( (Sympts \='dead'), 
				(DaysSinceExposed =:= (IncubateDays+6)), 
				retract(person(IDListHd, Age, FamID, Sympts, IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)), 
				assert(person(IDListHd, Age, FamID, 'papules', IncubateDays, DaysSinceExposed, 'true', DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)) );
	 		( (Sympts \='dead'), 
				(DaysSinceExposed =:= (IncubateDays+7)), (7 < DiesDaysAftFever),
				retract(person(IDListHd, Age, FamID, Sympts, IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)), 
				assert(person(IDListHd, Age, FamID, 'vesicles', IncubateDays, DaysSinceExposed, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)) );
	 		( (Sympts \='dead'), 
				(DaysSinceExposed >= (IncubateDays+DiesDaysAftFever)), personIsDead(IDListHd) );
