	), updateSymptoms(IDListTl).

personIsDead(IDListHd) :- 
	retract(person(IDListHd, Age, FamID, Sympts, DaysSinceExposed, IncubateDays, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)), 
	assert(person(IDListHd, Age, FamID, 'dead', DaysSinceExposed, IncubateDays, IsDiag, DiesDaysAftFever, A1, A2, A3, A4, A5, A6, MixGroupsOutList)).

