firstStep(X) :-
	my_list(X), infectGroup(X), worsen(X), clearList(X), updateSymptoms(X),  setDayNum(999), setDay(999), writeDay(999).


step(X):-
	my_list(X), worsen(X), visit(X), afterVisit2(X), clearList(X), updateSymptoms(X), setDayNum(999), setDay(999), writeDay(999).


sim(X):-
	firstStep(X),
	step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X),step(X).

setDay(Last):-	
	day(Num, NotExposed, Exposed, Symptomatic, Dead, Diagnosed, Last),
	aggregate_all(count, person( _, _, _, 'notex', _, _, _, _, _, _,_,_,_,_,_), NotSymptomatic),
	aggregate_all(count, person( _, _, _, 'dead', _, _, _, _, _, _,_,_,_,_,_), NewDead),
	aggregate_all(count, person( _, _, _, _, _, 0, _, _, _, _,_,_,_,_,_), NewNotExposed),
	aggregate_all(count, person( _, _, _, 'papules', _, _, _, _, _, _,_,_,_,_,_), TempDiagnosed),
	NewSymptomatic is 500-NotSymptomatic,
	NewExposed is 500-NewNotExposed,
	NewDiagnosed is div(TempDiagnosed,2),
	retract(day(Num, NotExposed, Exposed, Symptomatic, Dead, Diagnosed, Last)),
	assert(day(Num, NewNotExposed, NewExposed, NewSymptomatic, NewDead, NewDiagnosed, Last)).

setDayNum(Last):-	
	day(Num, NotExposed, Exposed, Symptomatic, Dead, Diagnosed, Last),
	retract(day(Num, NotExposed, Exposed, Symptomatic, Dead, Diagnosed, Last)),
	NewNum is 1+Num,
	assert(day(NewNum, NotExposed, Exposed, Symptomatic, Dead, Diagnosed, Last)).

writeDay(Last):-
	day(Num, NotExposed, Exposed, Symptomatic, Dead, Diagnosed, Last),
	write('Day'),
	write(Num),
	write(': '),
	write(NotExposed),
	write(' Not Exposed, '),
	write(Exposed),
	write(' Exposed, '),
	write(Symptomatic),
	write(' Symptomatic, '),
	write(Diagnosed),
	write(' Diagnosed, '),
	write(Dead),
	write(' Dead \n').

